import "./UserForm.css";

const UserForm = () => {
  return (
    <form>
      <div className="form">
        <div className="lable">Enter Name</div>

        <input type="text"></input>

        <div className="lable">Enter Age</div>

        <input type="number"></input>
      </div>
    </form>
  );
};

export default UserForm;
